import React, { useState } from 'react';
import axios from 'axios';

const Feedback = ({ userId }) => {
    const [feedbackText, setFeedbackText] = useState('');
    const [message, setMessage] = useState('');

    const handleSubmit = async (e) => {
        e.preventDefault();
        try {
            const response = await axios.post('http://localhost:5000/api/feedback', { userId, feedbackText });
            setMessage(response.data.message);
        } catch (err) {
            setMessage(err.response.data.message);
        }
    };

    return (
        <div>
            <h2>Feedback</h2>
            <form onSubmit={handleSubmit}>
                <textarea value={feedbackText} onChange={(e) => setFeedbackText(e.target.value)} placeholder="Your feedback" required />
                <button type="submit">Submit Feedback</button>
                {message && <p>{message}</p>}
            </form>
        </div>
    );
};

export default Feedback;
